import { GenericContainer, StartedTestContainer } from 'testcontainers'
import { Test } from '@nestjs/testing'
import { AppModule } from '../../app.module'
import { VcQueryService } from './vc-query.service'
import neo4j from 'neo4j-driver'
import { TrustFramework2210ValidationService } from './tf2210/trust-framework-2210-validation.service'

jest.setTimeout(100000)

async function insertQuads(quads: string) {
  const _driver = neo4j.driver(process.env.dburl)
  const credentialUUID = TrustFramework2210ValidationService.getUUIDStartingWithALetter()
  const queries = VcQueryService.quadsToQueries(credentialUUID, quads)
  const session = _driver.session()
  for (const query of queries) {
    await session.executeWrite(tx => tx.run(query))
  }
  await session.close()
  return credentialUUID
}

describe('VCQueryService', () => {
  let memgraphContainer: StartedTestContainer, vcQueryService: VcQueryService

  beforeAll(async () => {
    memgraphContainer = await new GenericContainer('memgraph/memgraph:latest').withExposedPorts(7687).start()
    process.env.dburl = `bolt://${memgraphContainer.getHost()}:${memgraphContainer.getMappedPort(7687)}`
    const moduleRef = await Test.createTestingModule({
      imports: [AppModule],
      providers: [VcQueryService]
    }).compile()
    vcQueryService = moduleRef.get<VcQueryService>(VcQueryService)
  })

  afterAll(async () => {
    await memgraphContainer.stop()
  })

  it('should return LRN issuer when present', async () => {
    const credentialUUID = await insertQuads(lrnQuads)
    const lrnIssuer = await vcQueryService.searchForLRNIssuer(credentialUUID)
    expect(lrnIssuer).toEqual(['registration.lab.gaia-x.eu/development'])
  })

  it('should return all issuers of VCs from a VP', async () => {
    const credentialUUID = await insertQuads(fullVPQuads)
    const issuers = await vcQueryService.retrieveIssuers(credentialUUID)

    expect(issuers).toBeDefined()
    expect(issuers).toContain('registration.lab.gaia-x.eu/development')
    expect(issuers).toContain(
      'wizard.lab.gaia-x.'
    )
  })

  describe('ServiceOffering validations', () => {
    describe('hasDataResource', () => {
      it('should return false when the VP contains no resource', async () => {
        const credentialUUID = await insertQuads(fullVPQuads)
        const hasDataResource = await vcQueryService.hasDataResource(credentialUUID)
        expect(hasDataResource).toBeFalsy()
      })
      it('should return true when the VP contains data ressource', async () => {
        const credentialUUID = await insertQuads(VPWithResourcesNotContainingPII)
        const hasDataResource = await vcQueryService.hasDataResource(credentialUUID)
        expect(hasDataResource).toBeTruthy()
      })
    })
    describe('checkServiceOfferingIssuerMatchesProvidedByIssuer', () => {
      it('should return true when SO has the same issuer than SO producedBy issuer', async () => {
        const credentialUUID = await insertQuads(VPWithResourcesNotContainingPII)
        const hasLegitimateInterestIfContainsPIIOrHasNoPII = await vcQueryService.checkServiceOfferingIssuerMatchesProvidedByIssuer(credentialUUID)
        expect(hasLegitimateInterestIfContainsPIIOrHasNoPII).toBeTruthy()
      })
      it('should return false when SO has not the same issuer than SO producedBy issuer', async () => {
        const credentialUUID = await insertQuads(VPWithSOAndResourceIssuerDifferentFromParticipantIssuer)
        const hasLegitimateInterestIfContainsPIIOrHasNoPII = await vcQueryService.checkServiceOfferingIssuerMatchesProvidedByIssuer(credentialUUID)
        expect(hasLegitimateInterestIfContainsPIIOrHasNoPII).toBeFalsy()
      })
    })
    describe('checkDataResourceIssuerMatchesProducedByIssuer', () => {
      it('should return true when DataResource has the same issuer than producedBy issuer', async () => {
        const credentialUUID = await insertQuads(VPWithResourcesNotContainingPII)
        const hasLegitimateInterestIfContainsPIIOrHasNoPII = await vcQueryService.checkDataResourceIssuerMatchesProducedByIssuer(credentialUUID)
        expect(hasLegitimateInterestIfContainsPIIOrHasNoPII).toBeTruthy()
      })
      it('should return false when DataResource has not the same issuer than producedBy issuer', async () => {
        const credentialUUID = await insertQuads(VPWithSOAndResourceIssuerDifferentFromParticipantIssuer)
        const hasLegitimateInterestIfContainsPIIOrHasNoPII = await vcQueryService.checkDataResourceIssuerMatchesProducedByIssuer(credentialUUID)
        expect(hasLegitimateInterestIfContainsPIIOrHasNoPII).toBeFalsy()
      })
    })
    describe('hasLegitimateInterestIfContainsPIIOrHasNoPII', () => {
      it('should return true when a resource has no PII and no LegitimateInterest', async () => {
        const credentialUUID = await insertQuads(VPWithResourcesNotContainingPII)
        const hasLegitimateInterestIfContainsPIIOrHasNoPII = await vcQueryService.hasLegitimateInterestIfContainsPIIOrHasNoPII(credentialUUID)
        expect(hasLegitimateInterestIfContainsPIIOrHasNoPII).toBeTruthy()
      })
      it('should return false when a resource has PII and no LegitimateInterest', async () => {
        const credentialUUID = await insertQuads(VPWithResourcesContainingPIIAndNoLegitimateInterest)
        const hasLegitimateInterestIfContainsPIIOrHasNoPII = await vcQueryService.hasLegitimateInterestIfContainsPIIOrHasNoPII(credentialUUID)
        expect(hasLegitimateInterestIfContainsPIIOrHasNoPII).toBeFalsy()
      })
      it('should return true when a resource has PII and LegitimateInterest', async () => {
        const credentialUUID = await insertQuads(VPWithResourcesContainingPIIAndLegitimateInterest)
        const hasLegitimateInterestIfContainsPIIOrHasNoPII = await vcQueryService.hasLegitimateInterestIfContainsPIIOrHasNoPII(credentialUUID)
        expect(hasLegitimateInterestIfContainsPIIOrHasNoPII).toBeTruthy()
      })
    })
  })
})

